import React from 'react'

interface PostProps {
  caption: string,
  content: string,
  userId: string

}
const Post = ({caption, content, userId}: PostProps) => {
  return (
    <div><h1>
      
      {caption}
      </h1>
      
      <h1>
        {content}
      </h1>

      <h1>
        {userId}
      </h1>
      
      </div>
  )
}

export default Post
